window.bookSummaryJSON = "<p><i>New York Times</i> best-selling authors Neil Gaiman and Michael Reaves deliver a thrilling sequel to the science fiction novel <i>InterWorld,</i> full of riveting interdimensional battles and alternate realities. </p> <p>After mastering the ability to walk between dimensions, Joey Harker and his fellow InterWorld freedom fighters are now on a mission to maintain peace between the rival powers of magic and science who seek to control all worlds. </p> <p>When a stranger named Acacia somehow follows Joey back to InterWorld's base, things get complicated. No one knows who she is or where she's from - or how she knows so much about InterWorld. </p> <p>Dangerous times lie ahead for Joey and the mission. There's a traitor hidden among them, and if Joey has any hope of saving InterWorld, the multiverse, and the mission, he's going to have to rely on his wits - and, just possibly, on the mysterious Acacia Jones. </p> <p>With a story conceived by Neil Gaiman and Michael Reaves and written by Michael and Mallory Reaves, this mind-bending follow-up to the exciting science fiction novel <i>InterWorld</i> is a compelling fantasy adventure through time and space, in which the future depends on a young man who is more powerful than he realizes.</p>"; 
